import React from "react"

const Part = (props) =>{
    return (
        <div>
            {props.course.parts.map((item)=>{
                return (
                
                <p> {item.name} {item.exercises} </p>)
                })
            }
        </div>
    )
}

const Content = (props) =>{
    return (
        <Part parts={props.course.parts} />
    )
}

export default Content
